        api.get(`/pokemon/pokemon-in-web/1/`)
            .then((response) => {
                const data = response.data
                const [movimentos] = data.moves;
                console.log(movimentos)

            })
    }












    return (

        <div>
            <div>
            <button onClick={list}>testes</button>

            </div>

        </div>




    )
}

export default GetOnePokemonInWeb;
